import React from "react";
import UsersAPI from "./Api";
import { Link } from "react-router-dom";

const mapUser = url =>
    UsersAPI.all().map(u => (
		<div>
        <p>Soy una lista</p>
		<li key={u.id}>
            <Link to={`${url}/${u.id}`}>{u.name}</Link>
        </li>
		</div>
    ));

const AllUsers = ({ match }) => (
    <div>
        <ul>{mapUser(match.url)}</ul>
    </div>
);

export default AllUsers;
